// Contenedor2.js

import React from 'react';

function Contenedor2() 
  {
    const estiloContenedor = {
      backgroundColor: 'lightblue',
      border: '2px solid blue',
      padding: '10px',
    };
  return (
    <div style={estiloContenedor} className="contenedor contenedor2">
      <p>Contenedor 2</p>
      <ul style={{ color: 'red', fontSize: '16px' }}>
        <li>Elemento 1</li>
        <li>Elemento 2</li>
        <li>Elemento 3</li>
      </ul>
    </div>
  );
}

export default Contenedor2;
